// src/components/Login.js
import React from 'react';
import { Link } from 'react-router-dom';

function login() {
  return (
    <div>
      <h2>Login</h2>
      <Link to="/patient-login">
        <button>Patient Login</button>
      </Link>
      <Link to="/doctor-login">
        <button>Doctor Login</button>
      </Link>
    </div>
  );
}

export default login;
